func minOperations(nums []int, k int) int {
    count := make(map[int]int)
    // Initialize the map with 0 counts for each number from 1 to k.
    for i := 1; i <= k; i++ {
        count[i] = 0
    }

    operations := 0
    // Iterate from the end of the array.
    for i := len(nums) - 1; i >= 0; i-- {
        // If the current element is within 1 to k and not yet accounted for,
        // update the map.
        if nums[i] <= k && count[nums[i]] == 0 {
            count[nums[i]] = 1 // Mark as found.
            k-- // Decrease the remaining count of numbers to find.
        }
        operations++
        if k == 0 {
            // If k reaches 0, all numbers from 1 to k are found.
            return operations
        }
    }
    return operations
}
